import { createClient } from "@supabase/supabase-js";
const supabaseUrl =
  "https://jdalkyifqhvscmepedok.supabase.co/rest/v1/facts";
const supabaseKey =
  "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6ImpkYWxreWlmcWh2c2NtZXBlZG9rIiwicm9sZSI6ImFub24iLCJpYXQiOjE3MjA1NjE4MjAsImV4cCI6MjAzNjEzNzgyMH0.VLMy-JPzK0etxDGWaMMj39wilNI8Vh5LJPC7UT6xiVo";
const supabase = createClient(supabaseUrl, supabaseKey);

// Example fetch function to verify if the endpoint works correctly
async function fetchFacts() {
  const { data, error } = await supabase
    .from('facts')
    .select('*')
    .order('votesInteresting', { ascending: false })
    .limit(1000);

  if (error) {
    console.error('Error fetching facts:', error);
  } else {
    console.log('Fetched facts:', data);
  }
}

fetchFacts();

export default supabase;
